import React from 'react';
import { Box, Container, Typography, Paper, Avatar, useTheme, useMediaQuery } from '@mui/material';
import { useNavigate } from 'react-router-dom';

const AboutPage = () => {
  const theme = useTheme();
  const navigate = useNavigate();
  const isMobile = useMediaQuery(theme.breakpoints.down('sm'));

  const teamMembers = [
    {
      name: 'John Doe',
      role: 'Founder & CEO',
      bio: 'Passionate about reading and technology, John started this platform to make reading more accessible to everyone.'
    },
    {
      name: 'Jane Smith',
      role: 'Lead Developer',
      bio: 'Full-stack developer with a love for creating seamless reading experiences across all devices.'
    },
    {
      name: 'Alex Johnson',
      role: 'UI/UX Designer',
      bio: 'Focused on creating intuitive and beautiful interfaces that make reading a joy.'
    }
  ];

  return (
    <Box sx={{ py: 8 }}>
      {/* Hero Section */}
      <Box 
        sx={{
          bgcolor: 'primary.main',
          color: 'primary.contrastText',
          py: 12,
          mb: 8,
          textAlign: 'center'
        }}
      >
        <Container maxWidth="md">
          <Typography 
            variant={isMobile ? 'h3' : 'h2'} 
            component="h1"
            gutterBottom
            sx={{ fontWeight: 'bold' }}
          >
            About Our E-Reader Platform
          </Typography>
          <Typography variant="h6" sx={{ maxWidth: 800, mx: 'auto', opacity: 0.9 }}>
            Empowering readers with a modern, accessible, and feature-rich digital reading experience.
          </Typography>
        </Container>
      </Box>

      {/* Our Story */}
      <Container maxWidth="lg" sx={{ mb: 8 }}>
        <Box sx={{ mb: 6, textAlign: 'center' }}>
          <Typography variant="h4" component="h2" gutterBottom>
            Our Story
          </Typography>
          <Typography variant="body1" color="text.secondary" sx={{ maxWidth: 800, mx: 'auto' }}>
            Founded in 2023, our e-reader platform was born out of a passion for reading and technology. 
            We noticed that while digital reading was becoming increasingly popular, many platforms were 
            either too complex or lacked essential features for serious readers. We set out to create 
            a solution that combines the best of technology with the joy of reading.
          </Typography>
        </Box>

        {/* Mission & Vision */}
        <Box 
          sx={{ 
            display: 'grid', 
            gridTemplateColumns: { xs: '1fr', md: '1fr 1fr' }, 
            gap: 4,
            mb: 8 
          }}
        >
          <Paper elevation={3} sx={{ p: 4, height: '100%' }}>
            <Typography variant="h5" component="h3" gutterBottom>
              Our Mission
            </Typography>
            <Typography color="text.secondary">
              To make reading more accessible, enjoyable, and convenient for everyone, 
              by providing a platform that understands and adapts to the needs of modern readers.
            </Typography>
          </Paper>
          <Paper elevation={3} sx={{ p: 4, height: '100%' }}>
            <Typography variant="h5" component="h3" gutterBottom>
              Our Vision
            </Typography>
            <Typography color="text.secondary">
              We envision a world where everyone has access to the books they love, 
              with a reading experience that's personalized, intuitive, and available 
              anytime, anywhere.
            </Typography>
          </Paper>
        </Box>

        {/* Team Section */}
        <Box sx={{ textAlign: 'center', mb: 8 }}>
          <Typography variant="h4" component="h2" gutterBottom>
            Meet Our Team
          </Typography>
          <Typography variant="body1" color="text.secondary" sx={{ mb: 4, maxWidth: 700, mx: 'auto' }}>
            We're a passionate team of book lovers, developers, and designers dedicated to 
            creating the best reading experience for you.
          </Typography>

          <Box 
            sx={{ 
              display: 'grid', 
              gridTemplateColumns: { 
                xs: '1fr', 
                sm: 'repeat(2, 1fr)',
                lg: 'repeat(3, 1fr)' 
              }, 
              gap: 4,
              mt: 4
            }}
          >
            {teamMembers.map((member, index) => (
              <Paper 
                key={index} 
                elevation={3} 
                sx={{ 
                  p: 3, 
                  display: 'flex', 
                  flexDirection: 'column',
                  alignItems: 'center',
                  height: '100%'
                }}
              >
                <Avatar 
                  sx={{ 
                    width: 120, 
                    height: 120, 
                    mb: 3,
                    bgcolor: 'primary.main',
                    fontSize: '3rem'
                  }}
                >
                  {member.name.split(' ').map(n => n[0]).join('')}
                </Avatar>
                <Typography variant="h6" component="h3" gutterBottom>
                  {member.name}
                </Typography>
                <Typography 
                  color="primary" 
                  sx={{ 
                    fontWeight: 'medium',
                    mb: 2
                  }}
                >
                  {member.role}
                </Typography>
                <Typography color="text.secondary">
                  {member.bio}
                </Typography>
              </Paper>
            ))}
          </Box>
        </Box>

        {/* Call to Action */}
        <Box 
          sx={{ 
            textAlign: 'center',
            mt: 8,
            p: 4,
            borderRadius: 2,
            bgcolor: 'action.hover',
            maxWidth: 800,
            mx: 'auto'
          }}
        >
          <Typography variant="h5" component="h2" gutterBottom>
            Ready to Start Reading?
          </Typography>
          <Typography color="text.secondary" sx={{ mb: 3, maxWidth: 600, mx: 'auto' }}>
            Join thousands of readers who have already discovered their next favorite book on our platform.
          </Typography>
          <button 
            onClick={() => navigate('/register')}
            style={{
              backgroundColor: theme.palette.primary.main,
              color: theme.palette.primary.contrastText,
              border: 'none',
              padding: '10px 24px',
              borderRadius: '4px',
              cursor: 'pointer',
              fontSize: '1rem',
              fontWeight: 500,
              textTransform: 'uppercase',
              letterSpacing: '0.02857em',
              boxShadow: theme.shadows[2],
              '&:hover': {
                backgroundColor: theme.palette.primary.dark,
                boxShadow: theme.shadows[4],
              }
            }}
          >
            Sign Up Free
          </button>
        </Box>
      </Container>
    </Box>
  );
};

export default AboutPage;
